import React, {useEffect, useState} from "react"
import axios from "axios"
import { Tarjetavercuentas } from "../../Componentes/Cuentas/Tarjetavercuentas"
function Vercuentas() {
    const token="eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyOTI5NGJkZTc0NDAwMTAxZWFhNDE4ZiIsImlhdCI6MTY1NTA1MjY4NywiZXhwIjoxNjU1MTM5MDg3fQ.zCDs6PDNFUxN_5DfsC4BL73wp78J0jDs0VhrmUesxIE"
    const [cuentas, setCuentas] = useState([])

    useEffect(()=>{
        axios.get("/cuentas",{ headers: {"x-access-token" : `${token}`} })
        .then(response => setCuentas(response.data))
        .catch(error => console.log(error))
    },[])

      
    return <div className='grid grid-cols-3 gap-2'>
        {cuentas.map(cuenta=>(
            <Tarjetavercuentas cuentadatos={cuenta} key={cuenta._id}/>
        ))}

    </div>
    
  
}

export default Vercuentas
